# 1. 라벨인코딩
from sklearn.preprocessing import LabelEncoder

ordinals = ['LotShape','LandSlope','OverallQual','OverallCond','ExterQual','ExterCond','BsmtQual',
           'BsmtCond','BsmtExposure','BsmtFinType1','BsmtFinType2','HeatingQC','Electrical','KitchenQual',
            'Functional','FireplaceQu','GarageFinish','GarageQual','GarageCond','PavedDrive','PoolQC','Fence']

# *** 코드의 논리적인 구성을 신경을 써서 해야 함!! *** #
# ===> 라벨인코딩에 대한 룰 : 오로지 trian에서 확립!!!
#                             그 기준을 train/test에 적용!!!
#                                       앗..test에 unseen 데이터 신경쓰자!!!
for col in ordinals:
    # 컬럼별로 정수값을 부여할 규칙 : sklearn --> LE --> 모델처럼!!!
    le = LabelEncoder()
    # 이 컬럼에 대한 규칙을 학습!!! : 오로지 train에서!!!
    le.fit( train_df[col])
    # col : A --->0, B-->1, c-->2 (train)
    train_df[col] = le.transform( train_df[col] )
    # ----> fit_transform으로 하셔도 됨!! : train쪽 변환은 끝!!!

    # **** test ***
    # 룰에 대한 수정!!!  ==> unseen 있는지 체크1!!
    prev_classes = list( le.classes_)
    for label in np.unique( test_df[col]):
        if label not in prev_classes: # unseen
            prev_classes.append( label)
    le.classes_ =  np.array( prev_classes )
    # col : A --->0, B-->1, c-->2 (train), d--> 3(test unseen)
    # =-==> unseen 데이터로 처리할 규칙으로 갱신!! --> 변환!!!
    test_df[col] = le.transform( test_df[col] )

test_df[col]

